import React from 'react';
import { useAuth } from '../context/AuthContext';

const MaidDashboard = () => {
  const { user } = useAuth();
  const stats = [
    { label: 'Pending Requests', value: '3', icon: 'üìã' },
    { label: 'Completed Jobs', value: '150', icon: '‚úÖ' },
    { label: 'This Month', value: '‚Çπ28,400', icon: 'üí∞' },
    { label: 'Rating', value: '4.8', icon: '‚≠ê' }
  ];

  return (
    <div className="max-w-7xl mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-2">Welcome, {user?.name}</h1>
      <p className="text-gray-600 mb-6">Manage requests and schedule</p>

      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
        {stats.map((s, i) => (
          <div key={i} className="dashboard-stat">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-blue-100 text-sm">{s.label}</p>
                <p className="text-3xl font-bold">{s.value}</p>
              </div>
              <div className="text-3xl">{s.icon}</div>
            </div>
          </div>
        ))}
      </div>

      <div className="bg-white rounded-lg shadow p-6">
        <h2 className="text-xl font-semibold mb-4">Pending Requests</h2>
        <div className="border rounded p-4">No live data yet. Hook to /api/bookings.</div>
      </div>
    </div>
  );
};

export default MaidDashboard;
